import Axios from "axios"


export const createStudent = async (data) => {
    return await Axios.post("http://127.0.0.1:8000/api/students", data).then(res => {
        return res.data;
    })
}

export const viewStudent = async (id) => {
    return await Axios.get("http://127.0.0.1:8000/api/students/"+id).then(res => {
        return res.data;
    })
}
